INSERT INTO `dream_results` VALUES (1,1,'이 꿈은 자기 내면의 기억과 정체성을 탐색하는 과정에서 나타나는 상징적 꿈으로, 현재 스스로에 대해 깊이 성찰하고 있음을 의미합니다.','오늘은 외부의 소음보다 자신의 감정과 생각에 귀를 기울이는 것이 중요한 날입니다. 조급하게 답을 찾기보다는, 잠시 멈추어 현재의 상태를 인식하는 것이 앞으로의 선택에 도움이 됩니다.','파란색',5,'파란색은 사고의 깊이와 내면의 안정, 그리고 감정의 정리를 상징하는 색으로, 복잡한 생각을 차분하게 정돈하는 데 도움을 줍니다.','노트','떠오르는 생각과 감정을 기록함으로써 내면의 흐름을 정리할 수 있으며, 꿈에서 느낀 감각을 현실로 이어주는 매개체가 됩니다.',NULL,0,'2025-11-01 08:05:00',NULL,NULL),(2,2,'이 꿈은 감정의 깊은 층위로 내려가고 있음을 상징하며, 무의식 속에 쌓여 있던 감정이 서서히 드러나는 시기를 의미합니다.','오늘은 감정을 억누르기보다 자연스럽게 인식하는 것이 중요한 날입니다. 명확한 결론을 내리려 하기보다는, 스스로의 상태를 받아들이는 것이 마음의 부담을 덜어줄 수 있습니다.','보라색',6,'보라색은 내면의 통찰과 감정의 정화를 상징하는 색으로, 복잡한 마음을 차분히 들여다보는 데 도움을 줍니다.','이어폰','외부의 소음을 차단하고 자신만의 리듬에 집중할 수 있도록 도와주는 아이템으로, 감정의 흐름을 정리하는 데 적합합니다.',NULL,0,'2025-11-02 08:05:00',NULL,NULL),(3,3,'반복되는 상황에 대한 무의식의 피로를 의미하는 꿈입니다.','오늘은 익숙한 선택에서 벗어나는 작은 변화가 도움이 됩니다.','회색',0,'회색은 중립과 휴식을 상징합니다.','편한 신발','부담 없는 선택을 돕습니다.',NULL,0,'2025-11-03 08:05:00',NULL,NULL),(4,4,'시간에 대한 압박과 조급함이 반영된 꿈입니다.','속도를 줄이고 순서를 지키는 것이 중요합니다.','갈색',1,'갈색은 안정과 현실 감각을 상징합니다.','머그컵','일상의 리듬을 회복하게 합니다.',NULL,0,'2025-11-04 08:05:00',NULL,NULL),(5,5,'닫힌 감정 속에서도 출구를 찾고 있음을 의미합니다.','작은 시도가 답답함을 완화시킵니다.','노란색',3,'노란색은 인식과 희망을 상징합니다.','포스트잇','생각을 가볍게 정리할 수 있습니다.',NULL,0,'2025-11-05 08:05:00',NULL,NULL),(6,6,'불확실한 미래에 대한 불안을 상징합니다.','결과보다 방향에 집중하세요.','주황색',2,'주황색은 움직임과 전환을 의미합니다.','백팩','앞으로 나아갈 준비를 돕습니다.',NULL,0,'2025-11-06 08:05:00',NULL,NULL),(7,7,'내면의 경고 신호를 반영한 꿈입니다.','감정을 무시하지 말고 점검하세요.','보라색',6,'보라색은 통찰을 상징합니다.','이어폰','자신에게 집중하도록 돕습니다.',NULL,0,'2025-11-07 08:05:00',NULL,NULL),(8,8,'기회에 대한 아쉬움과 기대가 섞인 상태를 의미합니다.','조급함을 내려놓는 것이 필요합니다.','파란색',5,'파란색은 감정의 안정에 도움을 줍니다.','손목시계','시간 관리에 도움을 줍니다.',NULL,0,'2025-11-08 08:05:00',NULL,NULL),(9,9,'감정 정화와 수용을 상징하는 꿈입니다.','오늘은 감정 표현에 솔직해도 괜찮습니다.','초록색',4,'초록색은 회복과 균형을 의미합니다.','식물','마음의 안정을 줍니다.',NULL,0,'2025-11-09 08:05:00',NULL,NULL),(10,10,'배움의 공백과 성찰을 의미하는 꿈입니다.','지금의 침묵은 준비 과정입니다.','갈색',1,'갈색은 기초와 축적을 상징합니다.','노트','기록을 통해 흐름을 잡을 수 있습니다.',NULL,0,'2025-11-10 08:05:00',NULL,NULL),(11,11,