될 징조입니다. 내면의 평정과 봉사 마인드가 앞으로의 길을 여는 인과관계로 작용할 것입니다.','오늘은 함께 있으면 웃음이 나는 사람들과의 일이 많아 즐거운 하루입니다. 모든 것을 완벽히 해내려는 부담은 오히려 해가 되니 여유를 가지세요. 마음가짐을 지키고 크게 상심하지 않으면 어려웠던 일도 차분히 풀립니다. 실내에 머무르기보다 밖으로 나가 몸을 움직이면 행운이 따릅니다. 봉사하는 태도와 신앙심을 잃지 않으면 뜻밖의 도움이 찾아올 것입니다.','초록색',4,'초록은 성장과 균형의 색으로 봉사와 내적 평정을 바라는 꿈의 의미와 오늘의 활동성, 외출 권유에 잘 맞아 마음을 안정시키고 대인관계를 원만하게 돕습니다.','팔찌','활동이 많고 대인관계가 활발해지는 시기에 간편하게 지니며 마음을 다잡고 연결감을 주어 행운을 불러오기 좋기 때문입니다.',NULL,0,'2025-12-23 23:58:29',NULL,NULL);
INSERT INTO `dream_results` VALUES (143,83,'크리스마스 이브에 비가 오지 않기를 바라는 꿈과 모두의 행복을 기원하는 내용입니다. 이 꿈은 순조로운 진행과 좋은 결과를 바라는 강한 바람을 나타내며 감정의 안정과 외부 조건(비)이 맞아떨어질 때 바람이 이루어짐을 암시합니다. 반대로 준비나 마음가짐이 흐트러지면 예상치 못한 불쾌한 일이 생길 수 있음을 경고합니다. 따라서 바라는 결과를 얻으려면 마음을 가다듬고 상황에 적극적으로 대응해야 합니다.','오늘은 어느 정도 행운이 따르지만 주된 성과는 본인의 노력에서 나옵니다. 소신과 고집이 빛나며 일관되게 추진해 온 일이 좋은 결실을 맺을 가능성이 큽니다. 주변의 인정과 찬사가 기대되며 승진이나 한단계 도약의 기회가 열릴 수 있습니다. 당신이 주체가 되어 계획을 밀고 나가면 좋은 결과를 얻으니 감정의 기복을 다스리고 꾸준히 행동하세요.','파란색',5,'감정을 안정시키고 집중력을 높여 꾸준한 노력을 지속하게 해 줍니다. 비를 걱정하는 꿈의 불안감을 가라앉히고 일관된 추진력으로 주변의 신뢰를 얻는 데 도움이 됩니다.','명함지갑','대인관계와 업무에서 역할이 커지고 영향력을 발휘할 기회가 많아지는 시기라 첫인상과 네트워킹이 중요합니다. 실용적으로 사용하면서 신뢰를 전달하기에 적합합니다.','data:image/png;base64,',0,'2025-12-24 00:02:10','2025-12-24 00:04:08',NULL);
/*!40000 ALTER TABLE `dream_results` ENABLE KEYS */;

--
-- Table structure for table `dreams`
--

DROP TABLE IF EXISTS `dreams`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `dreams` (
  `dream_id` bigint NOT NULL AUTO_INCREMENT COMMENT '꿈 ID',
  `user_id` bigint NOT NULL COMMENT '사용자 ID',
  `emotion_id` tinyint NOT NULL COMMENT '감정 ID',
  `dream_date` date NOT NULL COMMENT '꿈 꾼 날짜',
  `title` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '꿈 제목',
  `content` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '꿈 내용',
  `created_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `deleted_date` datetime DEFAULT NULL,
  PRIMARY KEY (`dream_id`),
  KEY `user_id` (`user_id`),
  KEY `emotion_id` (`emotion_id`),
