/*!40000 ALTER TABLE `dreams` DISABLE KEYS */;
INSERT INTO `dreams` VALUES (1,2,1,'2025-11-01','유리 계단 아래에서 울리던 이름','끝이 보이지 않는 도서관에 서 있었다. 천장은 유리였고, 비가 오지 않는데도 물방울이 맺혀 천천히 떨어졌다. 계단은 투명해서 발을 디딜 때마다 아래로 내 그림자가 길게 늘어졌다. 책들은 모두 제목이 없었고, 펼치면 문장 대신 사람들의 목소리가 흘러나왔다. 어떤 목소리는 웃고, 어떤 목소리는 울었다. 그 사이에서 누군가 내 이름을 불렀다. 돌아보면 아무도 없었지만, 부름은 점점 가까워졌다. 나는 소리를 따라 내려갔고, 마지막 계단에서 유리가 깨지듯 몸이 가벼워졌다. 잠에서 깬 뒤에도 귀에 남은 것은 소리가 아니라, 나를 부르던 침묵의 감촉이었다.','2025-11-01 08:00:00','2025-12-23 20:27:40',NULL),(2,2,2,'2025-11-02','물속에서 울리던 종소리','깊이를 알 수 없는 물속을 걷고 있었다. 발밑은 분명 바닥이 있었지만, 한 걸음 내디딜 때마다 몸이 조금씩 가라앉는 느낌이 들었다. 주변은 푸른빛으로 가득했고, 말소리는 모두 물에 잠긴 듯 흐릿했다. 멀리서 종소리가 들렸고, 나는 그 소리를 따라 움직였다. 종은 보이지 않았지만 울림만은 분명히 존재했다. 숨이 차오르기 직전, 물 위로 올라가자 소리는 멎었고 세상은 갑자기 조용해졌다. 깨어난 뒤에도 가슴 안쪽에 남은 압박감이 쉽게 사라지지 않았다.','2025-11-02 08:00:00','2025-12-23 20:27:40',NULL),(3,2,2,'2025-11-03','끝없이 이어진 복도','하얀 복도를 걷고 있었다. 문은 많았지만 손잡이가 없었고, 발소리만 유난히 크게 울렸다. 어느 순간 복도가 휘어지며 같은 장소로 되돌아왔다는 걸 깨달았다.','2025-11-03 08:00:00','2025-12-23 20:27:40',NULL),(4,2,3,'2025-11-04','깨진 시계','손목시계를 들여다보니 초침이 부서진 채 멈춰 있었다. 시간을 맞추려 할수록 바늘은 서로 엉켜 움직이지 않았다.','2025-11-04 08:00:00','2025-12-23 20:27:40',NULL),(5,2,1,'2025-11-05','창문 없는 방','사방이 막힌 방에 있었고 공기는 답답했다. 벽을 두드리자 미세한 금이 가며 빛이 스며들었다.','2025-11-05 08:00:00','2025-12-23 20:27:40',NULL),(6,2,4,'2025-11-06','모래로 된 길','길은 모두 모래로 되어 있었고 발자국은 금세 사라졌다. 뒤돌아보지 말라는 느낌만이 강하게 남았다.','2025-11-06 08:00:00','2025-12-23 20:27:40',NULL),(7,2,2,'2025-11-07','낮은 목소리','보이지 않는 누군가가 낮은 목소리로 말을 건넸다. 내용은 기억나지 않지만 불안함만 또렷했다.','2025-11-07 08:00:00','2025-12-23 20:27:40',NULL),(8,2,3,'2025-11-08','닫히는 엘리베이터','엘리베이터 문이 닫히는 순간 손을 뻗었지만 닿지 않았다. 위로 올라갈수록 가슴이 답답해졌다.','2025-11-08 08:00:00','2025-12-23 20:27:40',NULL),(9,2,1,'2025-11-09','비에 젖은 거리','비가 내리는 거리에서 우산 없이 서 있었다. 비는 차갑지 않았고 오히려 마음이 가벼워졌다.','2025-11-09 08:00:00','2025-12-23 20:27:40',NULL),(10,2,4,'2025-11-10','불 꺼진 교실','어두운 교실에 혼자 앉아 있었다. 칠판에는 아무것도 없었지만 설명을 듣고 있는 느낌이 들었다.','2025-11-10 08:00:00','2025-12-23 20:27:40',NULL),(11,2,2,'2025-11-11','천천히 잠기는 방','방 안에 물이 조금씩 차올랐다. 놀랍게도 숨은 쉬어졌고, 그 점이 더 불안했다.','2025-11-11 08:00:00','2025-12-23 20:27:40',NULL),(12,2,3,'2025-11-12','사라지는 이름','종이에 적힌 내 이름이 서서히 지워졌다. 지워질수록 이상하게 편안해졌다.','2025-11-12 08:00:00','2025-12-23 20:27:40',NULL),(13,2,2,'2025-11-13','가라앉는 다리','다리를 건너고 있었지만 강물은 점점 수면을 올리고 있었다. 발밑이 젖기 시작했고, 다리는 무너지지 않았지만 계속 낮아졌다. 끝에 도달했을 때는 이미 물이 허리까지 차 있었고, 나는 서둘러 숨을 고르며 뒤를 돌아보았다.','2025-11-13 08:00:00','2025-12-23 20:27:40',NULL),(14,2,1,'2025-11-14','멈춘 신호등','교차로 한가운데 서 있었고 모든 신호등은 동시에 빨간불이었다. 차도 사람도 움직이지 않았고, 정적 속에서 나만 이유 없이 초조해졌다. 언제 바뀔지 모르는 불빛을 바라보다 눈을 떴다.','2025-11-14 08:00:00','2025-12-23 20:27:40',NULL),(15,2,3,'2025-11-15','천천히 열리는 문','오래된 문 앞에 서 있었다. 문은 쉽게 열리지 않았지만 힘을 주지 않아도 조금씩 틈이 생겼다. 안쪽에서는 따뜻한 공기가 흘러나왔고, 그 기운에 마음이 조금 느슨해졌다.','2025-11-15 08:00:00','2025-12-23 20:27:40',NULL),(16,2,4,'2025-11-16','햇빛이 드는 복도','긴 복도를 걷다 보니 끝에서 햇빛이 들어왔다. 바닥에 비친 빛을 밟으며 걸을수록 몸이 가벼워졌고, 목적지가 명확해지는 느낌이 들었다.','2025-11-16 08:00:00','2025-12-23 20:27:40',NULL),(17,2,2,'2025-11-17','깨지는 유리컵','손에 들고 있던 유리컵이 이유 없이 갈라졌다. 물은 쏟아졌지만 바닥은 젖지 않았고, 나는 깨진 조각을 멍하니 바라보고 있었다.','2025-11-17 08:00:00','2025-12-23 20:27:40',NULL),(18,2,5,'2025-11-18','바람이 부는 언덕','언덕 위에 서자 강한 바람이 불었다. 몸은 흔들렸지만 불안하지 않았고, 오히려 숨이 시원하게 트이는 느낌이 들었다. 멀리 풍경이 또렷하게 보였다.','2025-11-18 08:00:00','2025-12-23 20:27:40',NULL),(19,2,3,'2025-11-19','지워지는 발자국','모래 위를 걸을 때마다 발자국이 바로 사라졌다. 남지 않는 흔적이 아쉬우면서도, 이상하게 마음은 가벼웠다.','2025-11-19 08:00:00','2025-12-23 20:27:40',NULL),(20,2,4,'2025-11-20','불이 켜진 방','어두운 방에 들어섰는데 불이 하나둘 켜졌다. 모든 것이 선명해지지는 않았지만, 더 이상 두렵지는 않았다.','2025-11-20 08:00:00','2025-12-23 20:27:40',NULL),(21,2,2,'2025-11-21','닫힌 창문','창문을 열려 했지만 손이 닿지 않았다. 바깥 풍경은 분명 보였고, 그 점이 더 답답하게 느껴졌다.','2025-11-21 08:00:00','2025-12-23 20:27:40',NULL),(22,2,5,'2025-11-22','잔잔한 호수','호수 앞에 앉아 물결을 바라보고 있었다. 아무 일도 일어나지 않았지만, 그 평온함이 오래 유지되기를 바랐다.','2025-11-22 08:00:00','2025-12-23 20:27:40',NULL),(23,2,3,'2025-11-23','느리게 흐르는 강','강가에 서서 물의 흐름을 바라보고 있었다. 물은 빠르지 않았고, 손을 담그자 차갑지도 따뜻하지도 않았다. 시간도 함께 천천히 흘러가는 느낌이 들었고, 서두를 필요가 없다는 생각이 자연스럽게 들었다.','2025-11-23 08:00:00','2025-12-23 20:27:40',NULL),(24,2,2,'2025-11-24','비어 있는 플랫폼','기차역 플랫폼에 혼자 서 있었다. 전광판에는 아무 일정도 표시되지 않았고, 언제 열차가 올지 알 수 없었다. 기다림이 길어질수록 발밑이 무거워졌다.','2025-11-24 08:00:00','2025-12-23 20:27:40',NULL),(25,2,4,'2025-11-25','정리된 책상','책상 위가 깔끔하게 정리되어 있었다. 무엇을 해야 할지 분명하지는 않았지만, 적어도 시작할 공간은 충분하다는 생각이 들었다.','2025-11-25 08:00:00','2025-12-23 20:27:40',NULL),(26,2,1,'2025-11-26','꺼지지 않는 알람','알람 소리가 계속 울렸지만 시계를 찾을 수 없었다. 소리는 점점 신경을 건드렸고, 멈추려 할수록 더 크게 들렸다.','2025-11-26 08:00:00','2025-12-23 20:27:40',NULL),(27,2,3,'2025-11-27','낮은 언덕','높지 않은 언덕을 천천히 오르고 있었다. 숨은 조금 찼지만 포기하고 싶지는 않았고, 정상에 가까워질수록 시야가 넓어졌다.','2025-11-27 08:00:00','2025-12-23 20:27:40',NULL),(28,2,5,'2025-11-28','따뜻한 불빛','어두운 거리 끝에서 따뜻한 불빛이 보였다. 그 불빛을 향해 걷는 동안 마음이 안정되었고, 도착했을 때는 이유 없는 안도감이 들었다.','2025-11-28 08:00:00','2025-12-23 20:27:40',NULL),(29,2,4,'2025-11-29','열린 창문','창문이 열려 있었고 바람이 방 안으로 들어왔다. 공기는 차가웠지만 상쾌했고, 답답함이 조금씩 사라졌다.','2025-11-29 08:00:00','2025-12-23 20:27:40',NULL),(30,2,5,'2025-11-30','조용한 아침','아침 햇살이 천천히 방 안을 채웠다. 특별한 사건은 없었지만, 하루를 시작하기에 충분히 안정적인 기분이었다.','2025-11-30 08:00:00','2025-12-23 20:27:40',NULL),(31,2,2,'2025-10-03','안개 낀 골목','짙은 안개가 낀 골목을 걷고 있었다. 앞은 잘 보이지 않았지만 발걸음을 멈추지는 않았다. 익숙한 길이라는 느낌만이 막연하게 남아 있었다.','2025-10-03 08:00:00','2025-12-23 20:27:58',NULL),(32,2,4,'2025-10-06','열린 노트','책상 위에 노트가 펼쳐져 있었고, 빈 페이지가 많았다. 무엇이든 적을 수 있을 것 같아 마음이 조금 가벼워졌다.','2025-10-06 08:00:00','2025-12-23 20:27:58',NULL),(33,2,1,'2025-10-08','부서진 거울','거울을 보자 얼굴이 조각나 보였다. 조각을 맞추려 했지만 손이 계속 미끄러졌다.','2025-10-08 08:00:00','2025-12-23 20:27:58',NULL),(34,2,3,'2025-10-11','느린 계단','계단을 오르는데 유난히 시간이 오래 걸렸다. 힘들지는 않았지만 속도가 나지 않았다.','2025-10-11 08:00:00','2025-12-23 20:27:58',NULL),(35,2,5,'2025-10-14','밝은 창가','햇빛이 가득 들어오는 창가에 서 있었다. 바람이 들어와 커튼이 천천히 흔들렸다.','2025-10-14 08:00:00','2025-12-23 20:27:58',NULL),(36,2,2,'2025-10-17','닫힌 서랍','서랍을 열려 했지만 열리지 않았다. 안에 무엇이 있는지는 알 수 없었고, 그 점이 답답했다.','2025-10-17 08:00:00','2025-12-23 20:27:58',NULL),(37,2,4,'2025-10-19','정리된 거리','거리가 깨끗하게 정돈되어 있었다. 사람은 많지 않았지만 불안하지는 않았다.','2025-10-19 08:00:00','2025-12-23 20:27:58',NULL),(38,2,1,'2025-10-22','꺼진 불빛','방 안의 불이 모두 꺼져 있었다. 스위치를 찾으려 했지만 손에 잡히지 않았다.','2025-10-22 08:00:00','2025-12-23 20:27:58',NULL),(39,2,3,'2025-10-26','흐르는 음악','어디선가 음악이 흘러나왔다. 정확한 멜로디는 기억나지 않았지만 기분은 차분해졌다.','2025-10-26 08:00:00','2025-12-23 20:27:58',NULL),(40,2,5,'2025-10-29','편안한 의자','의자에 앉아 잠시 쉬고 있었다. 아무 생각도 들지 않았고 그 상태가 오래가길 바랐다.','2025-10-29 08:00:00','2025-12-23 20:27:58',NULL),(41,2,2,'2025-09-02','젖은 운동화','비가 막 그친 거리에서 운동화를 신고 걷고 있었다. 물웅덩이를 피하려 했지만 끝내 발끝이 젖었다. 불쾌하기보다는 현실로 돌아온 느낌이 들었고, 천천히 걸음을 고르며 호흡을 맞췄다.','2025-09-02 08:00:00','2025-12-23 20:32:31',NULL),(42,2,4,'2025-09-05','열린 지도','탁자 위에 커다란 지도가 펼쳐져 있었다. 표시된 경로는 많았지만 선택지는 분명했고, 어디로 가든 출발할 수 있다는 안도감이 들었다.','2025-09-05 08:00:00','2025-12-23 20:32:31',NULL),(43,2,1,'2025-09-07','꺼지는 화면','눈앞의 화면이 깜빡이다가 꺼졌다. 다시 켜려 했지만 버튼이 보이지 않았고, 답답함만 남아 손을 멈췄다.','2025-09-07 08:00:00','2025-12-23 20:32:31',NULL),(44,2,3,'2025-09-10','낡은 계단','낡은 계단을 내려가며 손잡이를 꽉 잡았다. 삐걱거리는 소리는 컸지만 발판은 생각보다 단단했다.','2025-09-10 08:00:00','2025-12-23 20:32:31',NULL),(45,2,5,'2025-09-13','바람 부는 창가','창가에 서자 바람이 커튼을 흔들었다. 햇빛이 부드럽게 들어와 방 안이 밝아졌고, 마음이 편안해졌다.','2025-09-13 08:00:00','2025-12-23 20:32:31',NULL),(46,2,2,'2025-09-16','뒤엉킨 실타래','실타래가 서로 엉켜 풀리지 않았다. 급히 잡아당기지 않고 한 가닥씩 풀자 조금씩 정리되기 시작했다.','2025-09-16 08:00:00','2025-12-23 20:32:31',NULL),(47,2,4,'2025-09-18','정돈된 서가','서가에 책들이 가지런히 꽂혀 있었다. 아직 읽지 않은 책이 많았지만 부담은 느껴지지 않았다.','2025-09-18 08:00:00','2025-12-23 20:32:31',NULL),(48,2,1,'2025-09-21','막힌 터널','터널 앞에서 멈춰 섰다. 안쪽은 어두웠고 바람이 불어 나왔다. 들어갈지 말지 망설이다 그대로 깼다.','2025-09-21 08:00:00','2025-12-23 20:32:31',NULL),(49,2,3,'2025-09-24','느린 엘리베이터','엘리베이터가 천천히 올라갔다. 숫자는 분명히 바뀌고 있었고, 기다림이 길어도 불안하지 않았다.','2025-09-24 08:00:00','2025-12-23 20:32:31',NULL),(50,2,5,'2025-09-28','잔잔한 오후','오후의 햇살이 길게 드리웠다. 아무 일도 일어나지 않았지만 그 평온함이 충분하다고 느꼈다.','2025-09-28 08:00:00','2025-12-23 20:32:31',NULL),(51,2,3,'2025-08-01','햇볕에 말린 빨래','마당에 널린 빨래가 햇볕을 받아 천천히 마르고 있었다. 바람은 세지 않았고, 옷자락이 가볍게 흔들렸다. 특별한 일은 없었지만 그 장면이 오래 기억에 남았다.','2025-08-01 08:00:00','2025-12-23 20:33:26',NULL),(52,2,1,'2025-08-04','멈춘 선풍기','선풍기가 갑자기 멈췄고 방 안의 공기가 무겁게 느껴졌다. 다시 켜려 했지만 버튼이 말을 듣지 않아 답답함이 커졌다.','2025-08-04 08:00:00','2025-12-23 20:33:26',NULL),(53,2,4,'2025-08-07','밝은 계단','계단 위쪽에서 햇빛이 내려와 발밑을 비추고 있었다. 오를수록 숨은 찼지만 기분은 점점 가벼워졌다.','2025-08-07 08:00:00','2025-12-23 20:33:26',NULL),(54,2,2,'2025-08-10','흔들리는 버스','버스를 타고 가는 길에 차가 자주 흔들렸다. 창밖 풍경은 흐릿했지만, 목적지에 도착할 수 있다는 건 분명했다.','2025-08-10 08:00:00','2025-12-23 20:33:26',NULL),(55,2,5,'2025-08-12','시원한 그늘','나무 그늘 아래 앉아 쉬고 있었다. 더위는 느껴지지 않았고, 바람이 불 때마다 마음이 편안해졌다.','2025-08-12 08:00:00','2025-12-23 20:33:26',NULL),(56,2,3,'2025-08-15','빈 운동장','운동장 한가운데 서 있었지만 아무도 없었다. 넓은 공간이 오히려 숨통을 트이게 했다.','2025-08-15 08:00:00','2025-12-23 20:33:26',NULL),(57,2,2,'2025-08-18','엉킨 이어폰 줄','이어폰 줄이 심하게 엉켜 있었다. 급하게 풀지 않고 차분히 정리하자 조금씩 풀렸다.','2025-08-18 08:00:00','2025-12-23 20:33:26',NULL),(58,2,4,'2025-08-21','열린 창고','창고 문이 열려 있었고 안에는 정리된 물건들이 보였다. 필요할 때 꺼내 쓸 수 있을 것 같아 안심이 되었다.','2025-08-21 08:00:00','2025-12-23 20:33:26',NULL),(59,2,1,'2025-08-25','사라진 약속','달력에 적힌 약속이 지워져 있었다. 기억을 더듬어도 떠오르지 않아 불안함이 남았다.','2025-08-25 08:00:00','2025-12-23 20:33:26',NULL),(60,2,5,'2025-08-29','저녁 바람','해가 지고 선선한 바람이 불었다. 하루를 잘 마무리했다는 느낌이 자연스럽게 들었다.','2025-08-29 08:00:00','2025-12-23 20:33:26',NULL),(61,2,2,'2025-07-02','젖은 우산','비가 그친 뒤 우산을 접고 서 있었다. 물기가 남아 손에 차가웠지만, 더 이상 비를 맞지는 않아 다행이라는 생각이 들었다. 주변은 조용했고 숨을 고르기 좋았다.','2025-07-02 08:00:00','2025-12-23 20:34:11',NULL),(62,2,4,'2025-07-05','밝은 버스 정류장','버스 정류장에 햇빛이 비치고 있었다. 도착 시간은 정확하지 않았지만 기다림이 불안하지는 않았다.','2025-07-05 08:00:00','2025-12-23 20:34:11',NULL),(63,2,1,'2025-07-07','꺼진 휴대폰','휴대폰 화면이 갑자기 꺼졌고 전원이 켜지지 않았다. 연락해야 할 사람이 떠올라 더 답답해졌다.','2025-07-07 08:00:00','2025-12-23 20:34:11',NULL),(64,2,3,'2025-07-10','낮은 천장','천장이 낮은 방에 들어가 허리를 조금 숙여야 했다. 불편했지만 오래 머물 곳은 아니라는 생각이 들었다.','2025-07-10 08:00:00','2025-12-23 20:34:11',NULL),(65,2,5,'2025-07-13','시원한 바다','바닷가에 서서 파도를 바라보고 있었다. 물소리는 규칙적이었고, 마음이 자연스럽게 가라앉았다.','2025-07-13 08:00:00','2025-12-23 20:34:11',NULL),(66,2,2,'2025-07-16','엉킨 일정표','달력에 적힌 일정들이 서로 겹쳐 있었다. 하나씩 지워보니 생각보다 정리가 쉬웠다.','2025-07-16 08:00:00','2025-12-23 20:34:11',NULL),(67,2,4,'2025-07-19','열린 문','문이 활짝 열려 있었고 안쪽이 훤히 보였다. 들어가도 괜찮을 것 같다는 확신이 들었다.','2025-07-19 08:00:00','2025-12-23 20:34:11',NULL),(68,2,1,'2025-07-22','사라진 소리','주변 소리가 갑자기 사라졌다. 고요함이 편하지 않고 오히려 불안하게 느껴졌다.','2025-07-22 08:00:00','2025-12-23 20:34:11',NULL),(69,2,3,'2025-07-26','느린 자전거','자전거를 타고 천천히 길을 달렸다. 속도는 느렸지만 균형은 잘 잡혀 있었다.','2025-07-26 08:00:00','2025-12-23 20:34:11',NULL),(70,2,5,'2025-07-30','노을 진 하늘','하늘이 붉게 물들며 해가 지고 있었다. 하루를 무사히 보냈다는 안도감이 자연스럽게 들었다.','2025-07-30 08:00:00','2025-12-23 20:34:11',NULL),(71,2,3,'2025-06-02','이른 아침 공원','이른 아침 공원을 천천히 걷고 있었다. 사람은 거의 없었고 새소리만 간간이 들렸다. 서두르지 않아도 된다는 감각이 몸에 남아 있었다.','2025-06-02 08:00:00','2025-12-23 20:36:42',NULL),(72,2,1,'2025-06-04','끊어진 전화','통화를 하던 중 갑자기 소리가 끊겼다. 다시 걸어도 연결되지 않아 답답함이 커졌고, 이유를 알 수 없다는 점이 더 불안했다.','2025-06-04 08:00:00','2025-12-23 20:36:42',NULL),(73,2,4,'2025-06-07','정리된 서랍','서랍을 열어보니 물건들이 깔끔하게 정리되어 있었다. 필요한 것을 바로 찾을 수 있을 것 같아 마음이 놓였다.','2025-06-07 08:00:00','2025-12-23 20:36:42',NULL),(74,2,2,'2025-06-10','비어 있는 회의실','회의실에 혼자 앉아 있었다. 준비된 자료는 있었지만 시작할 사람은 없었고, 기다림이 길어질수록 집중이 흐트러졌다.','2025-06-10 08:00:00','2025-12-23 20:36:42',NULL),(75,2,5,'2025-06-13','초여름 바람','초여름 바람이 창문으로 들어왔다. 덥지도 춥지도 않은 온도가 기분 좋게 느껴졌고, 자연스럽게 미소가 지어졌다.','2025-06-13 08:00:00','2025-12-23 20:36:42',NULL),(76,2,3,'2025-06-16','느린 시계','벽시계가 평소보다 느리게 가는 것처럼 보였다. 초조함은 없었고, 이 속도도 나쁘지 않다고 느꼈다.','2025-06-16 08:00:00','2025-12-23 20:36:42',NULL),(77,2,2,'2025-06-19','흐트러진 책더미','책들이 여기저기 쌓여 있었고 무엇부터 정리해야 할지 막막했다. 하나를 집어 들자 생각보다 수월해질 것 같았다.','2025-06-19 08:00:00','2025-12-23 20:36:42',NULL),(78,2,4,'2025-06-22','밝은 주방','주방에 불이 켜져 있었고 공간이 환하게 느껴졌다. 간단한 준비만으로도 충분하다는 생각이 들었다.','2025-06-22 08:00:00','2025-12-23 20:36:42',NULL),(79,2,1,'2025-06-25','닫힌 문','앞을 가로막은 문이 굳게 닫혀 있었다. 열려고 해도 손잡이가 움직이지 않아 무력감이 밀려왔다.','2025-06-25 08:00:00','2025-12-23 20:36:42',NULL),(80,2,5,'2025-06-28','노을이 남은 저녁','해가 거의 졌지만 하늘에 노을이 남아 있었다. 하루를 잘 버텼다는 감각이 조용히 자리 잡았다.','2025-06-28 08:00:00','2025-12-23 20:36:42',NULL),(81,2,2,'2025-12-23','얼룩 계란, 계란 얼룩','분명히 기억나는 얼굴이었는데,\n꿈에 나온 그녀는 얼굴이 없었다.\n마치 누군가 얼굴을 너무 예쁘게 그려 놓고\n마지막에 물을 뿌려 번지게 하여 얼룩이 진 것 처럼 보였다.\n\n꿈 속에선 그녀와 함께 하루를 보내는 꿈을 꾸었는데,\n그녀의 얼굴이 보이지 않아도 웃고 있는지, 기분이 좋지 않은지 \n다 알 수 있었다.\n얼굴을 볼 순 없었지만 사무치게 다시 보고 싶은 느낌이 왜 계속 들었을까.\n\n그러다 거울 속 내 얼굴을 보니,\n볼에서 부터 얼룩이 나에게도 점점 생기기 시작했다.\n점점 얼룩은 커지더니, 내 얼굴을 삼켰다.\n그녀는 내가 얼룩이 되는 모습을 옆에서 지켜보기만 했다.\n\n그녀는 울고 있었을까, 웃고 있었을까.\n','2025-12-23 21:16:46','2025-12-23 23:57:25','2025-12-23 23:57:25'),(82,2,4,'2025-12-23','꿈일기입니다 저는 오늘 스님이 되었어요ㅗ','스님이 되는 꿈을 꿨어요 ','2025-12-23 23:57:45','2025-12-23 23:57:45',NULL),(83,2,2,'2025-12-24','오늘은 크리스마스 이브에요 ','크리스마스 이브에요\n비 안 왔으면 좋겠어요 \n모두모두 행복한 크리스마스 되세요','2025-12-24 00:01:26','2025-12-24 00:01:26',NULL);
