INSERT INTO `notice` VALUES (1,3,'몽글몽글을 이용해주셔서 감사합니다.','안녕하세요?\n몽글몽글 서비스의 관리자 글몽이 입니다.\n저희 서비스를 이용해주셔서 감사합니다.\n언제나 더 나은 서비스를 제공할 수 있도록 노력하도록 하겠습니다.\n\n따듯한 연말 되길 바라며, 감기 조심하시고\n잠을 못 이루고 계시다면 제 잠을 가져가\n편안한 밤이 되셨으면 합니다.\n감사합니다 :)',7,'2025-12-23 20:56:10','2025-12-24 08:14:53',NULL);
